#
# Structure for table "vw_psb_siswa_kriteria"
#

DROP VIEW IF EXISTS `vw_psb_siswa_kriteria`;
CREATE VIEW `vw_psb_siswa_kriteria` AS 
  select `siswa`.`replid` AS `idsiswa`,`siswa`.`nis` AS `nis`,`siswa`.`nisn` AS `nisn`,`siswa`.`nopendaftaran` AS `nopendaftaran`,`siswa`.`namasiswa` AS `namasiswa`,`siswa`.`status` AS `status`,`tingkat`.`replid` AS `idtingkat`,`tingkat`.`tingkat` AS `tingkat`,`subtingkat`.`replid` AS `idsubtingkat`,`subtingkat`.`subtingkat` AS `subtingkat`,`detailgelombang`.`replid` AS `iddetailgelombang` from ((((((((((`psb_siswa` `siswa` join `psb_siswabiaya` `siswabiaya` on((`siswabiaya`.`siswa` = `siswa`.`replid`))) join `psb_detailbiaya` `detailbiaya` on((`detailbiaya`.`replid` = `siswabiaya`.`detailbiaya`))) join `psb_biaya` `biaya` on((`biaya`.`replid` = `detailbiaya`.`biaya`))) join `aka_subtingkat` `subtingkat` on((`subtingkat`.`replid` = `detailbiaya`.`subtingkat`))) join `aka_tingkat` `tingkat` on((`tingkat`.`replid` = `subtingkat`.`tingkat`))) join `psb_detailgelombang` `detailgelombang` on((`detailgelombang`.`replid` = `detailbiaya`.`detailgelombang`))) join `psb_gelombang` `gelombang` on((`gelombang`.`replid` = `detailgelombang`.`gelombang`))) join `aka_tahunajaran` `tahunajaran` on((`tahunajaran`.`replid` = `detailgelombang`.`tahunajaran`))) join `psb_golongan` `golongan` on((`golongan`.`replid` = `detailbiaya`.`golongan`))) join `departemen` on((`departemen`.`replid` = `detailgelombang`.`departemen`))) group by `siswa`.`replid`;

#
# Procedure "listTingkatByDept"
#

DROP PROCEDURE IF EXISTS `listTingkatByDept`;
CREATE PROCEDURE `listTingkatByDept`(IN `dept` int)
BEGIN
	SELECT t.replid, t.tingkat,t.urutan
	FROM
		aka_tingkat t
		JOIN aka_subtingkat st ON st.tingkat = t.replid
		JOIN aka_kelas k ON k.subtingkat = st.replid
	WHERE k.departemen = dept
	GROUP BY t.replid
	ORDER BY t.urutan ASC;
END;

